/* eslint-disable no-undef */
/* eslint-disable import/prefer-default-export */
/* eslint-disable no-multi-assign */
import { SET_CUSTOMER_INFO } from './actionType';

export const setCustomerInfo = (payload) = ({
  type: SET_CUSTOMER_INFO,
  payload
})
